import React from 'react';
import PropertyListing from '../components/PropertyListing';

function ListingPage({ LISTED }) {
  // Ensure that LISTED is an array, and if it's not, default to an empty array
  const rental = Array.isArray(LISTED) ? LISTED.map((rentals) => <PropertyListing key={rentals.id} {...rentals} />) : [];

  return (
    <div>
      <h1>Property Listings</h1>
      <ul>

        {rental}
      </ul>
    </div>
  );
}

export default ListingPage;
